Page[32]=new Array("Limitys-toiminto ohjaa kopioiden limitystä silloin, kun työstä tulostetaan useita kopioita. Kun limitys on otettu käyttään, kopiosarjat luovutetaan limittäin tulostimen luovutusalustalle. Limitys on valittavissa vain, jos tulostimessa on limitysominaisuudella varustettu luovutusalusta.","Limitys/osat-toiminnon käyttäminen:","Osoita nuolta Paperi ja tulostus -ikkunan Viimeistely-kohdassa ja valitse Limitys/osat.","Valitse jokin vaihtoehto.","Tulostimen oletus: käyttää tulostimen oletusasetuksia.","Ei: Limitystä ei käytetä. Jako osiin voidaan silti valita.","Jokainen sarja: Kopiosarjat luovutetaan limittäin.","Jokainen osa luovuttaa osiin jaetun kopiosarjan osat limittäin.","Jokainen sarja ja osa luovuttaa kopiosarjat limittäin, samoin yhden kopiosarjan kunkin osan.","Jos haluat tulostaa työn osissa, valitse Ota käyttöön jako osiin.","Kirjoita Sivuja osassa -kohtaan kuhunkin osaan sisällytettävien sivujen määrä. Kussakin osassa on oltava sama määrä sivuja.","Valitse OK.","Limitys/osat","offset_subset.html");
