Page[34]=new Array("Vihkotoiminto tulostaa kaksi sivua arkin molemmille puolille. Tulostinajuri järjestää sivut arkeille niin että ne ovat oikeassa järjestyksessä, kun arkit taitetaan vihkoksi. Vihkoarkit voidaan sitten nitoa yhteen. Muista, että vihkoasemointi eroaa sellaisen asiakirjan asemoinnista, jossa arkin kummallekin puolelle tulostetaan vain yksi sivu. Erot koskevat lähinnä rivin- ja sivunvaihtoja.","Huom. ","Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Vihkoasemoinnissa sivuja ehkä pienennetään hieman, jotta ne mahtuvat kokonaan valitulle paperille.","Kopioiminen vihkoksi:","Osoita nuolta Tulostus vihkoksi -paneelin Vihkoviimeistely-kohdassa ja valitse haluamasi vaihtoehto.","Ei vihkoviimeistelyä tai Ei vihkotaittoa: tulostustyötä ei nidota eikä taiteta.","Vihkotaitto tai Vihkon taiveura: taittaa vihkoarkit keskeltä.","Vihkotaitto ja -nidonta tai Vihkon taiveura ja nidonta: taittaa vihkoarkit keskeltä ja nitoo ne taittokohdasta kahdella nitomanastalla.","Poista käytöstä vihkoasemointi: tulostustyöhön ei sovelleta vihkoasemointia. Valitse tämä vaihtoehto, jos tulostettava asiakirja on jo asemoitu vihkon muotoon.","Jos haluat, että tulostin skaalaa kuvan uuden paperikoon mukaan, osoita nuolia kohdassa Skaalaa uuteen paperikokoon. Valitse paperikoko. Oman paperikoon määrittämistä varten valitse Oma.","Aseta reunukset osoittamalla nuolta Vihkon reunukset -kohdassa ja valitsemalla haluamasi vaihtoehto.","Vakio pienentää sivut niin, että ne mahtuvat kokonaisuudessaan vihkoarkeille. Jos tulostin ei voi tulostaa paperin reunalle valitse Vakio.","Ei: Tämä tulostaa asiakirjan vihkoksi pienentämättä sivuja. Tällöin sivut voivat jäädä vajaiksi, jos tulostin ei pysty tulostamaan paperin reunoihin asti.","Huom. Esimerkissä näkyy kaksi A4-kokoista sivua A3-arkilla. Vasemmanpuoleisessa kuvassa näkyy tulos, kun on valittu normaalit reunukset. Oikeanpuoleisessa kuvassa näkyy tulos, kun reunuksia ei ole valittu.","Määritä sisäreunukset ja siirtymä tarpeen mukaan.","Sisäreunukset: määrittää sivujen väliin jäävän alueen leveyden pisteinä. Kirjoita pisteiden määrä tai valitse määrä nuolilla. Piste on 0,35 mm (1/72&quot;).","Siirtymä: määrittää, kuinka paljon sivuja siirretään ulospäin paperin keskikohdasta pisteen kymmenesosissa. Määritä siirron määrä kirjoittamalla arvo tai valitsemalla arvo nuolilla.","Valitse OK.","Tulostus vihkoksi","booklet_creation.html");
