Page[36]=new Array("Erikoissivuja ovat kannet, lisälehdet ja poikkeussivut. Poikkeussivujen asetukset eroavat muiden sivujen asetuksista.","Kansien lisääminen","Lisälehtien lisääminen","Poikkeussivujen lisääminen","Erikoissivujen hallinta","Tulostustyöhön ohjelmoidut erikoissivut näkyvät Erikoissivut-taulukossa. Tästä taulukosta voidaan valita muokattava tai poistettava sivu. Myös lisälehtien järjestystä voidaan muuttaa.","Kohteiden muokkaaminen, poistaminen ja siirtäminen:","Valitse tallennettujen töiden luettelosta haluamasi vaihtoehto. Painikkeet muuttuvat aktiivisiksi.","Valitse haluamasi toimenpide osoittamalla painiketta.","Erikoissivut","special_pages.html");
Page[37]=new Array("Lisää kannet -ikkunassa voidaan työhön lisätä kansilehdet ja määrittää kansilehdissä käytettävän paperin ominaisuudet. Työn asetukset -ruudussa näkyvät asiakirjan sivuja varten valitut paperiasetukset. Jos haluat käyttää samoja asetuksia kansilehdissä, valitse Käytä työn asetuksia.","Huom. Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Kansien lisääminen:","Valitse Erikoissivut-ikkunassa Lisää kannet.","Hyväksy työn oletusasetukset osoittamalla OK.","Valitse haluamasi vaihtoehto Kansiasetukset-luettelosta.","Ei kansia peruuttaa mahdolliset aiemmat kansivalinnat.","Vain etu: Tämä tulostaa ensimmäisen sivun valitulla alustalla olevalle paperille. Automaattisessa kaksipuolistulostuksessa kaksi ensimmäistä sivua tulostetaan kansilehdelle.","Vain taka: Tämä tulostaa viimeisen sivun valitulla alustalla olevalle paperille. Automaattisessa kaksipuolistulostuksessa kaksi viimeistä sivua tulostetaan kansilehdelle, jos sivuja on parillinen määrä.","Etu ja taka: Sama: Tämä tulostaa etu- ja takakannen samalta alustalta.","Etu ja taka: eri: tulostaa etu- ja takakannen eri paperialustoilta.","Osoita nuolia Etukannen paperi- tai Takakannen paperi -kohdassa ja valitse paperin koko, väri ja tyyppi. ","Valitse kannen tulostusasetus.","Tyhjä tai esipainettu: kansilehtenä käytetään tyhjää tai esipainettua arkkia.","Tulostus etusivulle tulostaa kansilehden etusivulle.","Tulostus takasivulle: tulostaa kansilehden takasivulle.","Tulostus molemmille puolille: tulostaa kansilehden molemmille puolille.","Valitse OK.","Kansien lisääminen","add_covers.html");
Page[38]=new Array("Asiakirjaan voidaan lisätä tyhjä tai esipainettu lisälehti ennen ensimmäistä sivua tai määritettyjen sivujen jälkeen. Jos haluat esimerkiksi lisätä tyhjän arkin värillistä paperia asiakirjan eri osien väliin, kirjoita ylös kunkin osan viimeinen sivunumero. Käytä näitä sivunumeroita määrittäessäsi lisälehtien sijaintia.","Huom. Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Lisälehden lisääminen:","Valitse Erikoissivut-ikkunassa Lisää lisälehdet.","Valitse lisälehtiasetus:","Sivun 1 eteen sijoittaa lisälehden sivun 1 eteen.","Sivujen perään: sijoittaa lisälehden määritettyjen sivujen perään.","Jos valitset Sivut-kohdassa Sivujen perään, anna kutakin lisälehteä edeltävän sivun numero.","Valitse Määrä-kohdassa lisälehtien määrä.","Hyväksy työn oletusasetukset osoittamalla OK.","Osoita nuolia Paperi-kohdassa ja valitse paperin koko, väri ja tyyppi.","Valitse OK.","Lisälehtien lisääminen","add_inserts.html");
Page[39]=new Array("Lisää poikkeussivuja -toiminnolla voidaan määrittää työn sisältämät poikkeussivut. Poikkeussivujen asetukset eroavat työn muiden sivujen asetuksista. Erot voivat koskea esimerkiksi paperin kokoa, tyyppiä ja väriä. Myös puolisuuteen liittyvä asetus voi olla erilainen. Työssä voi olla useita poikkeussivuja.","Huom. Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Paperipoikkeukset","Valitse Erikoissivut-ikkunassa Lisää poikkeussivut.","Kirjoita Sivut-kenttään poikkeussivujen numerot. Erota yksittäiset sivut tai sivualueet pilkuilla. Määritä sivualue yhdysmerkin avulla. Jos haluat esimerkiksi määrittää sivut 1, 6, 9, 10 ja 11, kirjoita: 1, 6, 9-11.","Hyväksy työn oletusasetukset osoittamalla OK.","Osoita nuolia Paperi-kohdassa ja valitse koko, väri, tyyppi ja paino.","Jos valitset paperin tyypiksi Hakulehdet, kirjoita hakulehtien määrä Hakulehtiä sarjassa -kohtaan.","Jos valitset paperin tyypiksi Järjestetty, määritä paperityypin nimi ja arkkien määrä sarjassa.","Jos haluat muuttaa puolisuutta, valitse haluamasi vaihtoehto Puolisuus-kohdasta:","1-puolinen tulostus: tulostaa poikkeussivut vain paperiarkin toiselle puolelle.","2-puolinen: tulostaa poikkeussivut paperiarkin molemmille puolille niin, että sivuja käännetään pitkästä reunasta. Työ voidaan sitten sitoa pitkästä reunasta.","2-puolinen (lyhyt reuna): tulostaa poikkeussivut paperiarkin molemmille puolille niin, että sivuja käännetään lyhyestä reunasta. Työ voidaan sitten sitoa lyhyestä reunasta.","Valitse Tulostusväri-kohdassa haluamasi vaihtoehto.","Valitse OK.","Kuvapoikkeukset","Kuva-asetukset-ikkunassa voidaan muokata tulosteiden ulkonäköä.","Huom. Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Väri","Kirkas väriaine tai Objektikohtainen kirkastus","Kirkkaalla väriaineella saadaan tulostettuun kuvaan valokuvamainen pinta tai sitä voidaan käyttää kuvan, tekstin tai grafiikan korostamiseen.","Huom. Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Kirkkaan väriaineen käyttäminen:","Valitse haluamasi vaihtoehto Kirkas väriaine -ikkunan kohdassa Kirkkaan värin asetukset.","Tulostimen oletus: käyttää tulostimen nykyisiä asetuksia.","Kirkas täyttö: peittää koko sivun  kirkkaalla väriaineella.","Vain kuvat: Tämä peittää kirkkaalla värillä kuviksi tunnistetut objektit.","Vain teksti: peittää vain tekstin kirkkaalla väriaineella.","Vain grafiikka: peittää vain grafiikan kirkkaalla väriaineella.","Ei kuvia (vain teksti, grafiikka): Tämä peittää kirkkaalla värillä tekstin ja grafiikan, mutta ei kuvia.","Ei tekstiä (vain kuvat, grafiikka): Tämä peittää kirkkaalla värillä kuvat ja grafiikan, mutta ei tekstiä.","Ei grafiikkaa (vain kuvat, teksti): Tämä peittää kirkkaalla värillä kuvat ja tekstin, mutta ei grafiikkaa.","Estä kirkastaminen: estää sivun ja sen osien peittämisen kirkkaalla väriaineella.","Käytä upotettua kirkastusta: Tulostin soveltaa kirkasta väriä PDL:n sisältämien ohjeiden mukaisesti.","Tulostin käyttää tulostettavien sivujen kokoamisessa sivunkuvauskieltä (Page Description Language, PDL). Sivunkuvauskieliä ovat PostScript (PS) ja Printer Command Language (PCL).","Määritä kirkkaan väriaineen määrä napsauttamalla nuolta Kirkkaan värin määrä -kohdassa ja valitsemalla haluamasi vaihtoehto.","Valitse OK.","Reunasiloittelu","Reunasiloittelu silottaa nimensä mukaisesti kuvan ja tekstin sahalaitaisia reunoja.","Reunasiloitteluasetuksen valitseminen:","Valitse Kuva-asetukset-ikkunan Reunasiloittelu-kohdassa haluamasi vaihtoehto.","Tulostimen oletus: käyttää tulostimen nykyisiä asetuksia.","Kyllä: ottaa käyttöön reunasiloittelun.","Ei: poistaa käytöstä reunasiloittelun.","K100 % - suuritarkkuuksinen: käyttää terävää ja yhtenäistä mustaa. Tätä voi käyttää silloin, kun työ sisältää tarkkaa tekstiä tai grafiikkaa, jossa on yhtenäisiä mustia alueita.","Käyttäjän TCR-käyrät","Sävyntoisto- eli TRC-käyrien avulla voidaan säilyttää värien yhdenmukaisuus. Käyttäjän TCR-käyrät mahdollistavat värien hienosäädön käyriä säätämällä.","Tulostaminen käyttämällä TRC:tä:","Valitse Kuva-asetukset-ikkunan Sävyntoistokäyrät (TCR) -kohdassa haluamasi vaihtoehto.","Tulostimen oletus: käyttää tulostimen oletusasetuksia.","Valitse nimi kymmenen viimeisimmän TCR-nimen luettelosta.","Anna uusi nimi.","Tarkkuus","Tarkkuus määrittää kuvien laadun. Tarkkuus ilmoitetaan pisteinä tuumaa kohti (dots per inch eli dpi). 600 dpi:n asetus tuottaa kuvat tulostamalla 600 pistettä kuvan jokaista tuumaa kohti. Suurempi tarkkuus tuottaa laadukkaampia kuvia.","Tarkkuuden määrittämistä varten valitse Tarkkuus ja valitse sitten haluamasi vaihtoehto tai valitse Tulostimen oletus.","Rasteri","Rasteroinnissa pienten pisteiden tummuuden, tiheyden ja koon vaihteluilla esitetään muutokset kuvan väreissä ja kirkkaudessa. Kuvan tarkkuuden määrää pisteiden määrä tuumaa kohti. Mitä enemmän pisteitä tuumaa kohti, sitä tarkempi kuva. Rasteri kutsutaan joskus puolisävyksi.","Satunnaisessa (stokastisessa) rasteroinnissa pisteet ovat satunnaisella etäisyydellä toisistaan. Pisteiden tiheys määritetään toivotun harmaasävyn mukaan. Stokastinen rasteri suunniteltiin estämään moire-ilmiön syntyminen. Satunnaisluonteensa vuoksi stokastinen rasteri soveltuu erinomaisesti valokuvien hahmonnukseen.","Rasterin valitseminen:","Valitse Kuva-asetukset-ikkunassa Rasteri ja valitse sitten haluamasi vaihtoehto.","Tulostimen oletus: käyttää tulostimen oletusasetuksia.","Valitse arvo. Mitä enemmän pisteitä, viivoja tai viivoja/tuuma (lpi) valitset, sitä tarkempia ovat tulosteet.","Valitse Satunnainen.","Värinsäästö","Värinsäästö vähentää tulostustyöhön käytettävän väriaineen määrää ja soveltuu vedoslaatuiseen tulostukseen. Tulostuslaatu on hieman normaalia huonompi.","Ota värinsäästö käyttöön osoittamalla nuolta Kuva-asetukset-ikkunan Värinsäästö-kohdassa ja valitsemalla sitten Kyllä.","Kuvansiirto","Kuvansiirtotoiminnolla voidaan muokata kuvan sijaintia sivulla. Kuvaa voidaan siirtää sekä X- että Y-suunnassa.","Kuvansiirtoasetusten määrittäminen:","Osoita nuolta Kuvansiirtoasetukset kohdassa ja valitse haluamasi vaihtoehto.","Jos valitsit 1-puolinen Paperi ja tulostus -ikkunassa, valitse haluamasi vaihtoehto Kuvansiirtoasetukset-kohdassa.","Tulostimen oletus: käyttää tulostimen oletusasetuksia.","Riippumaton: mahdollistaa kuvansiirron manuaalisen säätämisen.","Jos valitsit 2-puolinen Paperi ja tulostus -ikkunassa, valitse haluamasi vaihtoehto Kuvansiirtoasetukset-kohdassa.","Tulostimen oletus: käyttää tulostimen oletusasetuksia.","Riippumaton: mahdollistaa kuvansiirron manuaalisen säätämisen.","X: peili: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä, mutta vastakkaisiin suuntiin vaakasuunnassa.","Y: peili: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä, mutta vastakkaisiin suuntiin pystysuunnassa.","X ja Y: peili: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä, mutta vastakkaisiin suuntiin vaaka- ja pystysuunnassa.","X: peili, Y: sama: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä, vastakkaisiin suuntiin vaakasuunnassa, samaan suuntaan pystysuunnassa.","Y: peili, X: sama: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä, vastakkaisiin suuntiin pystysuunnassa, samaan suuntaan vaakasuunnassa.","X: sama: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä ja samaan suuntaan vaakasuunnassa.","Y: sama: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä ja samaan suuntaan pystysuunnassa.","X ja Y: sama suunta: kuvaa voidaan siirtää paperin molemmilla puolilla sama määrä ja samaan suuntaan vaaka- ja pystysuunnassa.","Tee jokin seuraavista Eri kuin etu -kohdassa","Anna etusivua varten kuvansiirron määrä X- ja Y-suunnassa.","Anna takasivua varten kuvansiirron määrä X- ja Y-suunnassa.","Huom. Kuvansiirto takasivulla on käytettävissä vain, jos on valittu 2-puolinen tulostus.","Valitse OK.","Korostusväri","Korostusväri mahdollistaa tärkeän tekstin tai tekstin osien korostamisen tulosteissa.","Korostustavan valitseminen:","Valitse Kuva-asetukset-ikkunassa Korostusväri.","Valitse jokin vaihtoehto.","Tulostimen oletus: käyttää tulostimen oletusasetuksia.","Yhdistelyalgoritmi: määrää, miten kaikki värit tulostetaan lukuun ottamatta väriä, joka valitaan kohdassa Korostusväri (yhdistely). Valinnat soveltavat erilaisia algoritmeja eri tuloksia varten.","Korostusväri (yhdistely): valitsee tietyn värin korostusta varten.","Korostusväri (tulostus): tulostaa asiakirjan valitulla värillä.","Käytäntö ristiriitatilanteessa: määrittää, miten toimitaan kun valitun värin ja tulostimen väriominaisuuksien välillä on ristiriita.","Tummuus","Poikkeussivujen lisääminen","add_exceptions.html");
