Page[41]=new Array("Väriasetukset tarjoavat lisää vaihtoehtoja värien muokkaamiseen.","Huom. Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Värinsäädöt","Valitse Kuva-asetukset-ikkunassa Väri.","Värien säätöä varten poista liukusäätimien alapuolella olevien Tulostimen oletus -valintaruutujen valinta.","Tummuus: säätää tekstin ja kuvien yleistä tummuutta.","Kontrasti: säätää tummien ja vaaleiden alueiden välistä kontrastia.","Värikylläisyys: säätää värin voimakkuutta ja värin sisältämän harmaan määrää.","Värihuntu: käsittää kolme asetusta - yksi syaania/punaista varten, yksi magentaa/vihreätä varten ja yksi keltaista/sinistä varten. Valitun värin määrää voidaan säilyttämällä kuitenkin kuvan vaaleus. Jos kaikki kolme liukusäädintä asetetaan samaan asentoon, värihuntua ei synny. Värihuntu-asetusta sovelletaan kaikkiin syöttöväreihin paitsi alkuperäisiin ja SWOP CMYK -väreihin.","Värihuntu on hieman toisella värillä kuten ruskealla, vaaleanpunaisella tai keltaisella sävyttynyt harmaa.","Valitse OK.","Väriasetukset","Osoita nuolta Väri-ikkunassa ja valitse Väriasetukset.","Valitse Mustan päälletulostuksen ja Lihotuksen asetukset. Tiettyjä Syöttösuunta-asetuksia varten valitse Lihotus-kohdassa Kyllä.","Lihotus saa aikaan sen, että värillisten alueiden reunat, valkoisia alueita lukuun ottamatta, tulostuvat hieman viereisten värillisten ja mustien alueiden reunojen päälle Lihotus kompensoi kohdistusvirheitä, jotka voivat johtua paperin siirtymisestä tai muista ongelmista.","Musta päälletulostus estää mustan objektin taustan poistamisen, kun sen päälle tulostetaan väreissä. Tällä toiminnolla on suuri merkitys kohdistusvirheiden yhteydessä. Poistettu tausta aiheuttaa sen, että mustan objektin reunoilla näkyy valkoinen kaistale. Tämä valkoinen kaistale voidaan eliminoida valitsemalla Musta päällekirjoitus.","Poista Tulostimen oletus -valintaruutujen valinta ja säädä pituutta ja leveyttä.","Valitse OK.","Lähdeväri","Osoita nuolta Väri-ikkunassa ja valitse Lähdeväri.","Valitse haluamasi asetukset RGB-väriavaruutta, CMYK-väriavaruutta ja Harmaa väriavaruutta varten.","Valitse Kuvaprofiili-kohdassa Tulostimen oletus, muu vaihtoehto tai Oma.","Valitse Teksti- ja grafiikkaprofiili-kohdassa Tulostimen oletus, muu vaihtoehto tai Oma.","Valitse OK.","Tulostusväri","Tulostusväri-toiminnolla voidaan ohjata värien hahmonnusta tulosteissa. Hahmonnus määrittää tavan, jolla värejä säädetään tulostuksen aikana halutun lopputuloksen saavuttamiseksi. Tulostin käyttää kohdeprofiilia muuttaessaan väridataa tulostuslaitteen väriavaruuteen sopivaksi.","Tulostusvärin valitseminen:","Osoita nuolta Väri-ikkunassa ja valitse Tulostusväri.","Valitse Kohdeprofiili-kohdassa haluamasi vaihtoehto.","Tulostimen oletus: käyttää tulostimen nykyisiä asetuksia.","Järjestelmän määrittämä: käyttää järjestelmänvalvojan määrittämiä asetuksia.","Oma: avaa Oma valinta -ikkunan, jossa voidaan antaa haluttu arvo.","Tee jokin seuraavista kuvaobjektin hahmonnusta, tekstiobjektin hahmonnusta ja grafiikkaobjektin hahmonnusta varten:","Jos haluat käyttää samaa, yhteen objektiin perustuvaa hahmonnusta kaikille objekteille, lisää valintamerkki Sama hahmonnus kaikille objekteille -ruutuun. Muiden objektien hahmonnus valitaan automaattisesti.","Jos haluat valita kunkin objektin hahmonnuksen erikseen, poista valintamerkki Sama hahmonnus kaikille objekteille -ruudusta ja valitse sitten haluamasi vaihtoehto kullekin objektille.","Valitse OK.","Laajennettu toistoala","Laajennettu toistoala -toiminto mahdollistaa laitteen tukemien värien käytön. Syaanin, magentan, keltaisen ja mustan lisäksi voidaan valita muita laitteessa tuettuja värejä. Tämä toiminto parantaa värintoistoa.","Huom. Käytettävissä olevat lisävärit riippuvat laitteesta.","Lisävärien valitseminen:","Napsauta nuolta Väri-ikkunassa ja valitse Väri.","Valitse haluamasi väri Laajennettu toistoala -luettelosta.","Valitse OK.","Jos haluat palauttaa alkuperäiset asetukset, valitse Oletukset.","Yhteenveto väreistä","color_summary.html");
Page[42]=new Array("Lisäspottiväritoiminto mahdollistaa laitteen tukemien värien käytön. Syaanin, magentan, keltaisen ja mustan lisäksi voidaan valita muita värejä, jotka ovat käytettävissä laitteessa. Nämä lisävärit korvaavat CMYK-värit ja tuottavat paremman värituloksen.","Huom. ","Kaikkia lueteltuja asetuksia ei tueta kaikissa tulostimissa. Jotkin asetukset koskevat vain tiettyä tulostinmallia, käyttöjärjestelmää tai ajurityyppiä.","Käytettävissä olevat lisävärit riippuvat laitteesta.","Lisäspottivärit ovat käytettävissä vain tulostettaessa työtä tai lisättäessä poikkeussivua tulostustyöhön.","Lisää poikkeussivuja -toiminnolla voidaan määrittää työn sisältämät poikkeussivut. Poikkeussivujen asetukset eroavat työn muiden sivujen asetuksista. Erot voivat koskea esimerkiksi paperin kokoa, tyyppiä ja väriä. Myös puolisuuteen liittyvä asetus voi olla erilainen. Työssä voi olla useita poikkeussivuja.","Valitse haluamasi lisäspottiväri Kuva-asetukset-ikkunassa.","Ei","Kulta","Hopea","Kirkas väri","Lisäspottiväri","additional_spot_colorant.html");
